from typing import List


class Solution:
    def maxSideLength(self, mat: List[List[int]], threshold: int) -> int:
        x = len(mat)
        y = len(mat[0])
        sz = min(x, y)

        pre = [[0 for _ in range(y)] for _ in range(x)]
        for i in range(x):
            s = 0
            for j in range(y):
                s += mat[i][j]
                pre[i][j] = s

        def get_row(a, b, l):
            s = pre[a][b + l - 1]
            if b == 0:
                return s
            return s - pre[a][b - 1]

        def get_sum(a, b, l):
            return sum(get_row(a + r, b, l) for r in range(l))

        while sz:
            for b in range(y - sz + 1):
                s = -1
                for a in range(x - sz + 1):
                    if s == -1:
                        s = get_sum(a, b, sz)
                    else:
                        # s1 = get_sum(a, b, sz)
                        s2 = s + get_row(a + sz - 1, b, sz) - get_row(a - 1, b, sz)
                        # if s1 != s2:
                        #     print(s1, s2)
                        # assert s1 == s2
                        s = s2
                    if s <= threshold:
                        print(sz)
                        return sz
            sz -= 1
        return 0


